import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import navLogo from '../assets/navlogo.png';

const AdminNavbar = ({ onLogout }) => {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const location = useLocation();

  const navItems = [
    { label: 'Dashboard', href: '/admin' },
    { label: 'Cars', href: '/admin' },
    { label: 'Analytics', href: '/admin' },
    { label: 'Settings', href: '/admin' },
    { label: 'Users', href: '/admin' },
    { label: 'Reports', href: '/admin' }
  ];

  const isActive = (href) => {
    if (href === '/admin') return location.pathname === '/admin';
    return location.pathname === href;
  };

  return (
    <nav className="admin-navbar">
      <div className="admin-navbar-container">
        <div className="admin-navbar-brand">
          <img src={navLogo} alt="CHALYATI Admin" className="admin-navbar-logo" />
          <span className="admin-navbar-title">CHALYATI Admin</span>
        </div>

        <div className="admin-navbar-menu">
          {navItems.map((item) => (
            <Link
              key={item.label}
              to={item.href}
              className={`admin-navbar-item ${isActive(item.href) ? 'active' : ''}`}
            >
              {item.label}
            </Link>
          ))}
        </div>

        <div className="admin-navbar-actions">
          <div className="admin-navbar-user">
            <span className="admin-navbar-user-name">Administrator</span>
          </div>
          <button onClick={onLogout} className="admin-navbar-logout">
            Logout
          </button>
        </div>

        {/* Hamburger menu for mobile */}
        <button 
          className="admin-navbar-hamburger"
          onClick={() => setIsDropdownOpen(!isDropdownOpen)}
          aria-label="Toggle navigation menu"
        >
          <span className={`hamburger-line ${isDropdownOpen ? 'open' : ''}`}></span>
          <span className={`hamburger-line ${isDropdownOpen ? 'open' : ''}`}></span>
          <span className={`hamburger-line ${isDropdownOpen ? 'open' : ''}`}></span>
        </button>
      </div>

      {/* Mobile dropdown menu */}
      {isDropdownOpen && (
        <div className="admin-navbar-dropdown">
          {navItems.map((item) => (
            <Link
              key={item.label}
              to={item.href}
              className={`admin-navbar-dropdown-item ${isActive(item.href) ? 'active' : ''}`}
              onClick={() => setIsDropdownOpen(false)}
            >
              {item.label}
            </Link>
          ))}
          <button onClick={onLogout} className="admin-navbar-dropdown-logout">
            Logout
          </button>
        </div>
      )}
    </nav>
  );
};

export default AdminNavbar;
